    false,nt"url": null,nt"notes": "Slope is derived from gridded (5 m cell
    size) bathymetry, from three sources: Multibeam bathymetry collected by Coral Reef
    Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; Multibeam bathymetry
    collected aboard the US Naval Ship Sumner, and lidar, both collected by Naval Oceanographic
    Office; and bathymetry derived from multispectral IKONOS satellite imagery. Cell
    values reflect the maximum rate of change (in degrees) in elevation between neighboring
    cells derived with the ArcGIS Spatial Analyst extension. This data set is for Tinian
    and Aguijan Islands, and Tatsumi Bank, Commonwealth of the Northern Marianas (CNMI).",nt"license_title":
